	add("thede", "{\"term\":\"thede\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Breton\", \"Welsh\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"middle high german (ca. 1050-1500)\", \"Icelandic\", \"Cornish\", \"Norwegian\", \"old irish (to 900)\"], \"text\":\"From Middle english (1100-1500) \u0027thede\u0027 from Old english (ca. 450-1100) {{m|ang|þēod||nation, people, tribe, race}}, from Proto-germanic {{m|gem-pro|*þeudō||people, nation}}, from Proto-indo-european {{m|ine-pro|*tewtéh₂||people}}. Cognate with Middle dutch (ca. 1050-1350) \u0027diet\u0027 (people) Middle high german (ca. 1050-1500) \u0027diet\u0027 (people, folk, nation) Norwegian \u0027tjod\u0027 (people, nation) Icelandic \u0027þjóð\u0027 (people, nation) Old irish (to 900) \u0027túath\u0027 (tribe, people, tribal territory) Welsh \u0027tud\u0027 (region, country, people) Breton \u0027tud\u0027 (people) Cornish \u0027tus\u0027 (people)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A nation; people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A country; land; kingdom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1508\u0027\u0027, Golagros \u0026amp; Gawane sig. aiiiiv\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"All the wyis in welth he weildis in \u0027\u0027theid\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, J. Douglas Bruce, \u0027Le Morte Arthur\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"For men told in many a \u0027\u0027thede\u0027\u0027 That launcelot by the quene lay\", \"priority\":6}]}, \"synonyms\":{}}");

