	add("thenar", "{\"term\":\"thenar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Ancient Greek θέναρ.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the palm of the hand or sole of the foo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027: the parts of the human anatomy most sensitive to cold being the nape, stomach, and \u0027\u0027thenar\u0027\u0027 or sole of foot? — James Joyce, \u0027Ulysses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the ball of the thumb, or the muscle controlling it\", \"priority\":3}]}, \"synonyms\":{}}");

	add("theocrat", "{\"term\":\"theocrat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|theo|crat|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ruler of a theocracy, a priest-king\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A proponent of theocracy\", \"priority\":2}]}, \"synonyms\":{}}");

