	add("theodicy", "{\"term\":\"theodicy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From the French \u0027théodicée\u0027 from Ancient greek (to 1453) \u0027θεός\u0027 (god) + \u0027δίκη\u0027 (justice)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A justification of a deity, or the attributes of a deity, especially in regard to the existence of evil and suffering in the world; a work or discourse justifying the ways of God\", \"priority\":1}]}, \"synonyms\":{}}");

