	add("theologian", "{\"term\":\"theologian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027theologien\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who studies theology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("theologist", "{\"term\":\"theologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|theology|ist|alt1\u003dtheolog(y)|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A theologian; one who is skilled, professes or practices of what relates with God\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1763\u0027\u0027 August 6, Elizabeth Carter, personal correspondence, in Montagu Pennington, \u0027Memoirs of the Life of Mrs. Elizabeth Carter [\u0026amp;hellip;]\u0027, Volume I, F. C. and J. Rivington (1808), page 319\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She told me with great joy and simplicity, that an English lady had told her, that our religion was very much alike. I think it is very possible that she fancied us to be Heathens or Turks, before this profound \u0027\u0027theologist\u0027\u0027 set her right\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1884,\u0027\u0027 William Chatterton Coupland, Translator\u0027s Preface to Eduard von Hartmann, \u0027Philosophy of the Unconscious: Speculative Results According to the Inductive Method of Physical Science\u0027, Volume I, MacMillan and Co., page viii\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"What would you have, says the scientist, but an ever-widening view of Nature\u0027s operations?\u0026amp;mdash;is it not enough, cries the \u0027\u0027theologist\u0027\u0027, to be sure that there is a God, although \u0026quot;His ways are past finding out?\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006,\u0027\u0027 Syafiq Hasyim, \u0027Understanding Women in Islam: An Indonesian Perspective\u0027, Equinox Publishing, ISBN 9793780193, page 32\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Besides being known as a \u0027\u0027theologist\u0027\u0027, he [Al-Razi] was noted for being a person of great \u0027farid\u0027 (beauty). \u0026amp;para; Al-Razi was an intellectual leader (\u0027imam\u0027) in the fields of Qur\u0027anic exegesis, Islamic theology, rational sciences, and linguistics\", \"priority\":7}]}, \"synonyms\":{}}");

	add("theomancy", "{\"term\":\"theomancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) {{confix|theo|mancy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of divination drawn from the responses of oracles among heathen nations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("theomania", "{\"term\":\"theomania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|theo|mania|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A religious mania\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mental illness in which the patient believes to be a god or to be possessed by one\", \"priority\":2}]}, \"synonyms\":{}}");

	add("theophany", "{\"term\":\"theophany\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027\u0027 corresponding to {{confix|theo|phany|lang\u003den}}, from \u0027θεο\u0027 (god) + \u0027φαίνω\u0027 (i shine, appear)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A manifestation of a deity to a man\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027The Case for God\u0027, Vintage 2010, p. 47\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was a bewildering \u0027\u0027theophany\u0027\u0027, since it was impossible to make out anything clearly in the stormy obscurity of thunder, lightning, smoke and wind\", \"priority\":3}]}, \"synonyms\":{}}");

	add("theophobia", "{\"term\":\"theophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|theo|phobia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A distaste for Gods and religion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1845\u0027\u0027, Tayler Lewis, \u0027Plato Contra Atheos: Plato Against the Atheists\u0027, page 131\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We see not how, even on this scheme most ingenious as it is, the atheist can expect to find relief from his tormenting \u0027\u0027theophobia\u0027\u0027, or escape that object of his greatest dread, \u0027a superhuman being\u0027, whether he styles him a God or a Daemon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Erich Wasmann, \u0027The Berlin Discussion of the Problem of Evolution\u0027, page 47\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In many scientific circles there is an absolute \u0027\u0027theophobia\u0027\u0027, a dread of the Creator\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, Robert Loyalty Cru, \u0027Diderot as a Disciple of English Thought\u0027, page 421\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Patriotism and \u0027\u0027theophobia\u0027\u0027 are the sources of great tragedies and terrifying pictures\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Morris A. Inch, \u0027Elder Brother: A Christian Alternative to Anti-Semitism\u0027, page 81\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;One might postulate at this point that persons suffer from \u0027\u0027theophobia\u0027\u0027, contempt for one thought to usurp their prerogatives\", \"priority\":9}]}, \"synonyms\":{}}");

	add("theorbo", "{\"term\":\"theorbo\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Turkish\"], \"text\":\"From Italian \u0027tiorba\u0027 from Turkish \u0027torba\u0027 \u0026lt;ref\u0026gt;[http://encarta.msn.com/dictionary_1861719557/theorbo.html \u0026quot;theorbo.\u0026quot;] Encarta World English Dictionary [North American Edition]. 2008.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A baroque, double-necked lute having an extra set of open bass strings\", \"priority\":1}]}, \"synonyms\":{}}");

	add("theory", "{\"term\":\"theory\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027théorie\u0027 from {{m|la|theōria}}, from Ancient greek (to 1453) \u0027θεωρία\u0027 (contemplation, speculation, a looking at, things looked at) from \u0027θεωρέω\u0027 (i look at, view, consider, examine) from \u0027θεωρός\u0027 (spectator) from \u0027θέα\u0027 (a view) + \u0027ὁράω\u0027 (i see,look)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mental conception; reflection, consideration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, \u0027Pseudodoxia Epidemica\u0027, VII.19\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As they encrease the hatred of vice in some, so doe they enlarge the \u0027\u0027theory\u0027\u0027 of wickednesse in all\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A coherent statement or set of ideas that explains observed facts or phenomena, or which sets out the laws and principles of something known or observed; a hypothesis confirmed by observation, experiment etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Duncan Steel, \u0027The Guardian\u0027, 23 May 2002\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It was only when Einstein\u0027s \u0027\u0027theory\u0027\u0027 of relativity was published in 1915 that physicists could show that Mercury\u0027s \u0026quot;anomaly\u0026quot; was actually because Newton\u0027s gravitational \u0027\u0027theory\u0027\u0027 was incomplete\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA, p. 118\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The world would need additional decades [...] before the Big Bang would begin to move from interesting idea to established \u0027\u0027theory\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027The Greatest Show On Earth: The Evidence for Evolution\u0027, Bantam, p. 10\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Scientists and creationists are understanding the word \u0026quot;\u0027\u0027theory\u0027\u0027\u0026quot; in two very different senses. Evolution is a \u0027\u0027theory\u0027\u0027 in the same sense as the heliocentric \u0027\u0027theory\u0027\u0027. In neither case should the word \u0026quot;only\u0026quot; be used, as in \u0026quot;only a \u0027\u0027theory\u0027\u0027\u0026quot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The underlying principles or methods of a given technical skill, art etc., as opposed to its practice\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Tony Bennett, \u0027Outside Literature\u0027, p. 139\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Does this mean, then, that there can be no such thing as a \u0027\u0027theory\u0027\u0027 of literature\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Elizabeth Souritz, \u0027The Great History of Russian Ballet\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Lopukhov wrote a number of books and articles on ballet \u0027\u0027theory\u0027\u0027, as well as his memoirs\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A field of study attempting to exhaustively describe a particular class of constructs\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Knot \u0027\u0027theory\u0027\u0027 classifies the mappings of a circle into 3-space\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A hypothesis or conjecture\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Wes DeMott, \u0027Vapors\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s just a \u0027\u0027theory\u0027\u0027 I have, and I wonder if women would agree. But don\u0027t men say a lot about themselves when a short-skirted woman slides out of a car or chair\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Sean Coughlan, \u0027The Guardian\u0027, 21 Jun 2003\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027theory\u0027\u0027 is that by stripping costs to the bone, they are able to offer ludicrously low fares\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A set of axioms together with all statements derivable from them. \u0027Equivalently,\u0027 a formal language plus a set of axioms (from which can then be derived theorems\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027theory\u0027\u0027 is consistent if it has a model\", \"priority\":24}]}, \"synonyms\":{}}");

	add("theosis", "{\"term\":\"theosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027theosis\u0027 from ecclesiastical Ancient greek (to 1453) \u0027θέωσις\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The likeness to or union with a god; deification\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 440\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For him, \u0027\u0027\u0027theosis\u0027\u0027\u0027 or deification was the destination for human salvation, whose attainment Adam\u0027s sin in Eden had imperilled but not rendered impossible\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The process of attaining this state\", \"priority\":4}]}, \"synonyms\":{}}");

	add("theosoph", "{\"term\":\"theosoph\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"Attested {{circa2|1835}}. From \u0027theosophus\u0027 (a theologian) \u0026lt;ref name\u003d\u0026quot;Century1911\u0026quot;/\u0026gt;from \u0027θεόσοφος\u0027 (wise in things concerning god) \u0026lt;ref name\u003d\u0026quot;Century1911\u0026quot;/\u0026gt;\u0026lt;ref name\u003d\u0026quot;OnlineEtylD\u0026quot;/\u0026gt;from Ancient greek (to 1453) {{compound|lang\u003dgrc|θεός|σοφός|t1\u003dgod|t2\u003dwise|nocat\u003d1}}.\u0026lt;ref name\u003d\u0026quot;Century1911\u0026quot;/\u0026gt;\u0026lt;ref name\u003d\u0026quot;OnlineEtylD\u0026quot;/\u0026gt;Cognate to French \u0027théosophe\u0027 (lang\u003dfr) \u0026lt;ref name\u003d\u0026quot;Century1911\u0026quot;/\u0026gt;\u0026lt;ref name\u003d\u0026quot;TLFi\u0026quot;/\u0026gt;cognate to Spanish \u0027teósofo\u0027 (lang\u003des) \u0026lt;ref name\u003d\u0026quot;Century1911\u0026quot;/\u0026gt;\u0026lt;ref name\u003d\u0026quot;DRAE2001\u0026quot;/\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A theosophist.\u0026lt;ref name\u003d\u0026quot;Century1911\u0026quot;/\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"where arose on some circumscribed basis of experiments, the speculative structures of the \u0027\u0027theosoph\u0027\u0027, the astrologer and the alchemist\", \"priority\":2}]}, \"synonyms\":{}}");

	add("theosophist", "{\"term\":\"theosophist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|theosophy|ist|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an advocate of, or believer in theosophy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"and \u0027\u0027Theosophists\u0027\u0027, as of feveral other men more palpably mad, that their thoughts are carried much to Astrology, it being a fancifull study built upon very slight grounds, and indeed I do not queftion, but a relique of the ancient superstition and Idolatry amongst the rude Heathens, which either their own Melancholy, or something worse, instructed them in\", \"priority\":2}]}, \"synonyms\":{}}");

	add("theosophy", "{\"term\":\"theosophy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|theosophia}}, from Ancient greek (to 1453) {{m|grc|θεοσοφῐ́ᾱ||knowledge of things divine}}, from {{compound|lang\u003dgrc|θεός|σοφῐ́ᾱ|t1\u003dgod|t2\u003dwisdom|nocat\u003d1}}; analogous to {{confix|theo|sophy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any doctrine of religious philosophy and mysticism claiming that knowledge of God can be attained through mystical insight and spiritual ecstasy, and that direct communication with the transcendent world is possible\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"month\u003dOct|volume\u003d8|location\u003d|publisher\u003dDavis issn\u003d0162-2188|url\u003dhttp://books.google.com/books?id\u003dsNhaAAAAYAAJ|passage\u003dThey have their own traditions of art and science. They do not discuss God or metaphysics or men. All their wisdom and \u0027\u0027theosophy\u0027\u0027, and all their grasp of beauty, truth or love, is in the singing. They look unloving enough, and so they are. Pitiless fallen angels\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any system which claims to attain communication with God and superior spirits by physical processes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The system of beliefs and doctrines of the\", \"priority\":4}]}, \"synonyms\":{}}");

	add("theotherapy", "{\"term\":\"theotherapy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|theo|therapy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of religion as therap\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"faith healing\", \"priority\":2}]}, \"synonyms\":{}}");

	add("theremin", "{\"term\":\"theremin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From its inventor w:Léon Theremin|Léon Theremin. \u0027theremin\u0027 is a French surname (compare Russian \u0027термен\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An electronic musical instrument that generates sound of varying pitch and volume depending on the proximity of the musician’s hands to two antennae mounted on the instrument\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thereness", "{\"term\":\"thereness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|there|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being there, or in some place; presence; existence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thermal", "{\"term\":\"thermal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027thermal\u0027 from {{m|la||*thermalis}}, from Ancient greek (to 1453) \u0027θέρμη\u0027 (heat)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A column of rising air in the lower atmosphere created by uneven heating of Earth\u0027s surface\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thermidorian", "{\"term\":\"thermidorian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027thermidorien\u0027 corresponding to {{suffix|Thermidor|ian|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who took part in, or supported, the overthrow of on the 9th Thermidor (27 July) 1794\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 501\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By then, the \u0027\u0027Thermidorians\u0027\u0027’ sights were already trained on a further target, namely, ‘the Four’, as they became known: Billaud-Varenne, Collot d\u0027Herbois and Barère from the old CPS and Vadier from the CGS\", \"priority\":3}]}, \"synonyms\":{}}");

