	add("thermophysiology", "{\"term\":\"thermophysiology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|thermo|physiology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A physiology that is subject to thermoregulatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027 - Australian mammal societ\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Laboratory studies of the \u0027\u0027thermo-physiology\u0027\u0027 of this species found that body temperature (Tb) was tightly regulated at 36. 1°C, but animals quickly become hyperthermic at ambient temperatures (Ta) above 30°C\", \"priority\":3}]}, \"synonyms\":{}}");

	add("thermoplanet", "{\"term\":\"thermoplanet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|thermo|planet|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A habitable planet, that has a surface temperature of 50–100°C, warmer than is optimal for most terrestrial life\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thermoresistance", "{\"term\":\"thermoresistance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|thermo|resistance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"resistance to heat\", \"priority\":1}]}, \"synonyms\":{}}");

